import ReactDOM from "react-dom/client";
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Login from "./components/Login.jsx";

function App(){
  return(
    App.render(
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="expenses" element={<Login />} />
          <Route path="invoices" element={<Login />} />
        </Routes>
      </BrowserRouter>
    )
  );
}


export default App;
